description:
Unless a comet can be destroyed before colliding with Earth, only those allowed into shelters will survive. Which people will survive?

Leo Beiderman joins a field study for his high school's Astronomy Club and discovers a new comet that unfortunately is headed for Earth. While scientists build a cave to prevent the extinction of the human race, they estimate that only 800,000 people can be selected to survive the &quot;Deep Impact&quot;. The threat of a comet ending the world quickly sends Americans into a panic until the president announces a plan to send astronauts on a mission to destroy the comet before it reaches earth...

